import React from 'react';

class Login extends React.Component{
    selmember = async (e) => {
        console.log(e);
    }

    render(){
        return (
            <form className="container" onSubmit={this.selmember}>
                <table className="justify-content-center">
                    <tbody>
                        <tr className="row">
                            <td className="col"><label htmlFor="id">ID</label><input type="text" name="id" id="id" className="form-control" /></td>
                        </tr>
                        <tr className="row">
                            <td className="col"><label htmlFor="pass">PassWord</label><input type="password" name="pass" id="pass" className="form-control" /></td>
                        </tr>
                        <tr className="row">
                            <td className="col"><input type="submit" value="로그인" className="btn bg-success" /></td>
                        </tr>
                    </tbody>
                </table>
            </form>
        );
    }
}

export default Login;
